Dinosaurs! Flight 19! The lost colony of Roanoke! Alien Greys! Ambrose Bierce?!

The mysterious disappearances of history have all wound up in the hollow world called The Faraway - and now so have Archer &amp; Armstrong and their arch-nemesis! Can the Valiant Universe's greatest conspiracy-busters find their way out before they're trapped forever? And we warn you to have your insurance premiums paid up before reading the last page revelation of the origin of The Boon - because your jaw will drop! (And probably need to be reattached surgically.)

Thanks goes to Nahga for this release.

